fetch spans, from: now() - 15m, scanLimitGBytes: 100
| filter isNull(span.parent_id)
| lookup [fetch spans, from: now() - 15m, scanLimitGBytes: 1000
  | filter isNotNull(http.url) AND isNotNull(k8s.namespace.name)
  | summarize count(), alias: cnt, by: {http.url, k8s.namespace.name, trace.id}
  ], sourceField: trace.id, lookupField: trace.id, prefix: "look."
| filter isNotNull(look.trace.id)
| summarize count(), alias: cnt, by: {look.http.url, look.k8s.namespace.name}
| filter  cnt > 10 AND cnt < 500
| sort cnt desc

